import { ADDTODO } from '../actions'

const initialState = {
    todo: ['adsf','qewr']
}

export default (state = initialState, action) => {
    switch (action.type) {
        case ADDTODO:
            console.log(state , "state")
            state.todo.push('state')
            return {todo : state.todo}
        default:
            return state
    }
}
